import React from "react";
import { Card, Row } from "react-bootstrap";
import styles from "./style/style.module.css";

function Welcome() {
  return (
    <Card className={styles.card}>
      <Row className={styles.backg}></Row>
    </Card>
  );
};

export default Welcome;
